import React from "react";
import styledComponents from "styled-components";

const HeaderContainer = styled.Header`
background-color: lightgreen;
display: flex;
align-items: center;
justify-content: space-around;
`

const Header = () => {
    <HeaderContainer>
    <h1>Labefy</h1>
    </HeaderContainer>
}
